    "2013-03-14T19:26:11.246002",nt"name": "inland-fisheries-length-weight-ds195",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset is a subset of the Tuolumne
    Aquatic Resources Relational Inventory (TARRI) compiled by Brian Quelvog, California
    Department of Fish & Game. This includes fork lengths and weights for species such
    as rainbow and brown trout, centrachids such as bluegill and green sunfish, cyprinids
    such as roach and hitch, as well as other groups (e.g., mosquitofish and catfish).
    Over seventy-five sources of information were used in making the data set including
    aquatic surveys by several agencies, although most of the information is contained
    in file reports from the California Department of Fish & Game. The area of interest
    includes Tuolumne County and the six surrounding counties: Calaveras, Stanislaus,
    Merced, Mariposa, Mono, and Alpine. Collection dates range from 1979 to 2003. What
    each record represents Each record represents the collection, identification, weight,
    and fork length of each individual of a given species of fish along with the zone,
    water, site, UTM coordinates, date, and person or organization responsible for the
    survey.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
